import React from 'react';

const AboutIntro = () => {
    return (
        <div className="ps-about-intro">
            <div className="ps-section__left">
                <div className="ps-section__content">
                    <h5>About us</h5>
                    <h3>Supro is the modern luxury shopping destination</h3>
                    <p>
                        We started in 2006 and haven’t stopped smashing it
                        since. A global brand that doesn’t sleep, we are 24/7
                        and always bringing something new with over 100 new
                        products dropping on the monhtly, bringing you the
                        latest looks for less.
                    </p>
                </div>
            </div>
            <div className="ps-section__right">
                <img src="/static/img/pages/about-intro.jpg" alt="" />
            </div>
        </div>
    );
};

export default AboutIntro;
